import React from 'react';
import { Router } from '@reach/router';
import Pokemon from './components/Pokemon'
import Starwars from './components/Starwars'
import BB from './components/BB';


function App() {
  return (
    <div>
      <Router>
        <Pokemon path="/" />
        <Starwars path="/starwars" />
        <BB path="/bb" />
      </Router>
    </div>
  );
}

export default App;
